import React, { Component } from "react";
import TopBar from "../Menu/MenuPage/TopBar";
import ScrollToTop from "react-scroll-to-top";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";

class CartPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      cartItems: JSON.parse(sessionStorage.getItem("cartItems")),
    };
    console.log(JSON.parse(sessionStorage.getItem("cartItems")));
  }
  render() {
    return (
      <div style={{ backgroundColor: "#FFCCCB" }}>
        <ScrollToTop
          smooth
          style={{
            position: "fixed",
            bottom: "11%",
            left: "47.5%",
            width: "6%",
            height: "6%",
            borderStyle: "solid",
            borderWidth: 1,
            borderColor: "#83858a",
          }}
          component={<h4 style={{ fontSize: 14 }}>Back to Top</h4>}
        />
        <TopBar />
        {this.state.cartItems.map((value) => {
          return <Card>value.name</Card>;
        })}
      </div>
    );
  }
}

export default CartPage;
